import React, { Component } from 'react';

import ResidentName from '../ResidentName';
import DateOfBirth from '../ResidentDOB';
import ResidentRoom from '../ResidentRoom';

class CarePlan extends Component {
  render() {
    return (
        <div className="container">
            <div>
                <h5>Resident Care Plan</h5>
                <span className="block-example border border-dark">
                <div className="row">
                    <div className="column">
                        <ResidentName />
                    </div>
                </div>
                <div className="row">
                    <div className="column">
                        <DateOfBirth/>
                    </div>
                    <div className="column">
                        <ResidentRoom/>
                    </div>

                </div>
            </span>
            </div>
            </div>

    );
  }
}

export default CarePlan;
